  false,\n\t\"url\": null,\n\t\"notes\": \"U.S. Daily Climate Normals (DSI-9641D)
  is archived at the National Climatic Data Center (NCDC). The climatological normals
  presented in this data set are based on monthly maximum, minimum, and mean temperature
  and monthly total precipitation records for each year in the 30-year period 1971-2000,
  inclusive (as well as separately computed monthly degree day totals). The monthly
  values are available in data set DSI-9641C or publication online (Climatography
  of the United States, No. 81 Monthly Station Normals of Temperature, Precipitation,
  and Heating and Cooling Degree Days, 1971-2000). In order to be included in the
  normals, a station had to have at least 10 years of monthly temperature data or
  10 years of monthly precipitation data for each month in the period 1971-2000. In
  addition, a station had to be active since January 1, 1999, or had to be included
  as a normals station in the 1961-1990 normals.\",\n\t\"license_title\": null,\n\t\"extras\":
